import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub  } from '@fortawesome/free-brands-svg-icons';

import './Projects.css';
import flashback from '../../assets/flashback.png';
import orderbudhome from '../../assets/order-bud-home.png';
import orderbudbusiness from '../../assets/order-bud-business.png';
import orderbudmenu from '../../assets/order-bud-menu.png';
import orderbudfriends from '../../assets/order-bud-friends.png';


const Projects = () => {

    const projectImages = [flashback, orderbudhome, orderbudmenu, orderbudbusiness]

    return (
        <div className="projects-section-main-container">
            <div className="projects-section-container">
                <div className="projects-header">
                    <div className="header-underline" />
                    <h1>Projects</h1>
                    <p>I love building cool things to learn new technologies and solve problems. Here are some of my most recent projects.</p>
                </div>
                <div className="project-container">
                    <div class="project">
                        <div className="project-images">
                            <img
                                src={orderbudmenu}
                                alt="order bud menu"
                                className="mobile-image-left"
                            />
                            <img
                                src={orderbudhome}
                                alt="order bud home"
                                className="mobile-image-main"
                            />
                            <img
                                src={orderbudfriends}
                                alt="order bud friends"
                                className="mobile-image-right"
                            />
                        </div>
                        <p>OrderBud</p>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Projects;
